    const paginationNumbers = [];

    for (let i = 1; i <= Math.ceil(total); i++) {
        paginationNumbers.push(i);
      }

  return (
    <div>
      {paginationNumbers.map((pageNumber) => (
        <button key={pageNumber}>{pageNumber}</button>
      ))}
    </div>
  );

}
